    pdsha = t1;
    pdmer = t2;
    switch geo
        case 0
            get_pd = nuendd*pdiso+nuintd*pdsha;
        case 1
            get_pd = (nuendd+nuintd)*pdsha;
        case 2
            get_pd = nuendd*pdiso+nuintd*pdsha;
        case 3
            get_pd = (nuendd+nuintd)*pdsha;
        case 4
            get_pd = nuendd*pdmer+nuintd*pdsha;
        case 5
            get_pd = nuendd*pdmer+nuintd*pdsha;
        case 6
            get_pd = nuendd*pdiso+nuintd*pdsha;
        case 7
            get_pd = (nuendd+nuintd)*pdsha;
        case 8
            get_pd = nuendd*pdmer+nuintd*pdsha;
        case 9
            get_pd = nf*pdsha;
        case 10
            get_pd = pdiso+(nf-1)*pdsha;
        otherwise 
            sim_strobe_vapp('Warning: Specified GEO = %d not matched', geo);

    end
end

