function get_rtot = get_rtot(nf, geo, rgeo, minsd, weffcj, rsh, dmcg, dmci, dmdg, type)
    rend = 0;
    nuintd = 0;
    nuendd = 0;
    nuints = 0;
    nuends = 0;
    if geo<9
        nuintd = get_nuintd(nf, minsd);
        nuints = get_nuints(nf, minsd);
        nuendd = get_nuendd(nf, minsd);
        nuends = get_nuends(nf, minsd);
        if type==1
            if nuints==0
                rint = 0;
            else
                rint = (rsh*dmcg)/(weffcj*nuints);
            end
        else
            if nuintd==0
                rint = 0;
            else
                rint = (rsh*dmcg)/(weffcj*nuintd);
            end
        end
    end
    switch geo
        case 0
            if type==1
                rend = get_rendi(weffcj, rsh, dmcg, dmci, dmdg, nuends, rgeo, 1);
            else
                rend = get_rendi(weffcj, rsh, dmcg, dmci, dmdg, nuendd, rgeo, 0);
            end
        case 1
            if type==1
                rend = get_rendi(weffcj, rsh, dmcg, dmci, dmdg, nuends, rgeo, 1);
            else
                rend = get_renda(weffcj, rsh, dmcg, dmci, dmdg, nuendd, rgeo, 0);
            end
        case 2
            if type==1
                rend = get_renda(weffcj, rsh, dmcg, dmci, dmdg, nuends, rgeo, 1);
            else
                rend = get_rendi(weffcj, rsh, dmcg, dmci, dmdg, nuendd, rgeo, 0);
            end
        case 3
            if type==1
                rend = get_renda(weffcj, rsh, dmcg, dmci, dmdg, nuends, rgeo, 1);
            else
                rend = get_renda(weffcj, rsh, dmcg, dmci, dmdg, nuendd, rgeo, 0);
            end
        case 4
            if type==1
                rend = get_rendi(weffcj, rsh, dmcg, dmci, dmdg, nuends, rgeo, 1);
            else
                rend = (rsh*dmdg)/weffcj;
            end
        case 5
            if type==1
                rend = get_renda(weffcj, rsh, dmcg, dmci, dmdg, nuends, rgeo, 1);
            else
                rend = (rsh*dmdg)/(weffcj*nuendd);
            end
        case 6
            if type==1
                rend = (rsh*dmdg)/weffcj;
            else
                rend = get_rendi(weffcj, rsh, dmcg, dmci, dmdg, nuendd, rgeo, 0);
            end
        case 7
            if type==1
                rend = (rsh*dmdg)/(weffcj*nuends);
            else
                rend = get_renda(weffcj, rsh, dmcg, dmci, dmdg, nuendd, rgeo, 0);
            end
        case 8
            rend = (rsh*dmdg)/weffcj;
        case 9
            if type==1
                rend = ((0.5*rsh)*dmcg)/weffcj;
                if nf==2
                    rint = 0;
                else
                    rint = (rsh*dmcg)/(weffcj*(nf-2));
                end
            else
                rend = 0;
                rint = (rsh*dmcg)/(weffcj*nf);
            end
        case 10
            if type==1
                rend = 0;
                rint = (rsh*dmcg)/(weffcj*nf);
            else
                rend = ((0.5*rsh)*dmcg)/weffcj;
                if nf==2
                    rint = 0;
                else
                    rint = (rsh*dmcg)/(weffcj*(nf-2));
                end
            end
        otherwise 
            sim_strobe_vapp('Warning: specified geo = %d not matched', geo);

    end
    if rint<=0
        get_rtot = rend;
    else
        if rend<=0
            get_rtot = rint;
        else
            get_rtot = (rint*rend)/(rint+rend);
        end
    end
    if get_rtot==0
        sim_strobe_vapp('Warning: zero resistance returned from get_rtot');

    end
end

function get_vjm = get_vjm(nvtm, ijth, isb, xexpbv)
    tc = xexpbv;
    tb = (1+ijth/isb)-tc;
    evjmovnv = 0.5*(tb+sqrt(tb*tb+4*tc));
    get_vjm = nvtm*log(evjmovnv);
end

function outVal = pow_vapp(base, exponent)
    outVal = base^exponent;
end
